<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":3576778972248703,"name":"Databricks for Data Scientists","language":"scala","commands":[{"version":"CommandV1","origId":3576778972248705,"guid":"f2dfbdc7-b500-4d76-b5bb-4c1b04ee03b2","subtype":"command","commandType":"auto","position":1.0,"command":"%md \n# Apache Spark on Databricks for Data Scientists\n\n** Welcome to Databricks! **\n\nThis notebook is intended to be the second step in your process to learn more about how to best use Apache Spark and Databricks together. We'll be walking through the core concepts, the fundamental abstractions, and some machine learning tools from the perspective of a data scientist! As a data scientist you're likely querying data from a variety of sources, joining together various tables and leveraging that information to build out statistical models. Databricks and Apache Spark make this process simple by allowing you to connect to a variety of sources and work with the data in one unified environment, then deploy your work to production quickly. Additionally because Databricks and Apache Spark support multiple languages, it's straightforward to do a lot of the analysis using the languages you know and the tools that you're likely already familiar with.\n\nFirst, it's worth defining Databricks. Databricks is a managed platform for running Apache Spark - that means that you do not have to learn complex cluster management concepts nor perform tedious maintenance tasks to take advantage of Apache Spark. Databricks also provides a host of features to help its users be more productive with Spark. It's a point and click platform for those that prefer a user interface like data scientists or data analysts. This UI is accompanied by a sophisticated API for those that want to automate jobs and aspects of their data workloads. To meet the needs of enterprises, Databricks also includes features such as role-based access control and other intelligent optimizations that not only improve usability for users but also reduce costs and complexity for administrators.\n\n** The Gentle Introduction Series **\n\nThis notebook is a part of a series of notebooks aimed to get you up to speed with the basics of Spark quickly. This notebook is best suited for those that have very little or no experience with Spark. The series also serves as a strong review for those that have some experience with Apache Spark but aren't as familiar with some of the more sophisticated tools like UDF creation and machine learning pipelines. The other notebooks in this series are:\n\n- [A Gentle Introduction to Apache Spark on Databricks](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055043/484361/latest.html)\n- [Apache Spark on Databricks for Data Scientists](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055194/484361/latest.html)\n- [Apache Spark on Databricks for Data Engineers](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055109/484361/latest.html)\n\n## Tutorial Overview\n\nThis tutorial centers around a core idea that we hope to explore:\n\n**주어진 zip code 지역내의 농산물 시장의 수를, 지역에서 지불한 수입과 세금으로 부터 추측한다.**\n\n주어진 재화만큼 시장이 있을 것이라는 단순한 가정하에 수입이 많을 수록 농산물 시장도 많을 것이라는 것은 타당한 듯 보인다. 물론 이 아이디어에는 많은 구멍이 있겠지만, 테스트할 필요가 충분히 있다. 본 학습은 이러한 가정이 얼마나 정확한 지 확인하는 과정을 안내한다. *이 예제는 학문적인 엄격함 보다는 Databricks로 작업하기 좋은 예제를 제공하는 데 그 의미가 있다.*\n\n## The Data\n\n![img](http://training.databricks.com/databricks_guide/USDA_logo.png)\n\n우리가 작업할 두개의 dataset 중 첫번째는 **Farmers Markets Directory and Geographic Data**이다. 이 dataset은 마켓의 위경도, 주, 주소, 이름, zip code 정보를 갖고 있다. raw data는 the Department of Agriculture에서 2015년 12월 1일 제공되었다.\n\n![img](http://training.databricks.com/databricks_guide/irs-logo.jpg)\n\n두번째 dataset은 SOI 세무 통계 - 개인 소득세 통계 - 우편 번호 데이터 (SOI)이다. 이 연구는 주 및 우편 번호 수준에서 개인 소득세 신고서에 대한 상세한 도표를 제공하며 국세청이 제공한다. 이 리포지토리에는 2013 년의 데이터 샘플 만 있고 \"AGI\"가 포함되어 있습니다. 우편 번호 데이터는 주, 우편 번호 및 조정 총소득의 크기로 분류된 수입 및 세금 항목을 보여준다. 데이터는 국세청에 제출 된 개인 소득세 신고서를 기반으로 하며 1998 년, 2001 년, 2004 년부터 2013 년까지의 세무 연도에 사용할 수 있다. 포함된 항목은 다음과 같다:\n\n- 가구 수를 근사하는 세금 신고 수\n- 인구를 근사하는 개인 면제 건 수\n- 조정 총소득\n- 임금 및 급여\n- 배제 전 배당금\n- 수입\n\n2개의 datasets에 대한 더 많은 정보는 data.gov 참고:\n\n- [Farmer's Market Data](http://catalog.data.gov/dataset/farmers-markets-geographic-data/resource/cca1cc8a-9670-4a27-a8c7-0c0180459bef)\n- [Zip Code Data](http://catalog.data.gov/dataset/zip-code-data)\n\n### Getting the Data\n\n데이터는 S3 또는 Redshift와 같은 장소에 저장될 것이다. Apache Spark는 이러한 데이터 소스에 간단하고 쉬운 커넥터를 제공하며 Databricks는 이를 사용하는 방법에 대한 간단한 데모를 제공한다. Databricks 가이드에서 왼쪽 상단의 `?`를 사용하여 데이터 소스가 사용 가능한지 확인한다. 이 튜토리얼을 위해, datasets 파일은 이미 DBFS를 통해 S3에서 사용 가능하다. [data.gov에서 제공되는 csv 파일을 테이블로 업로드](https://docs.cloud.databricks.com/docs/latest/databricks_guide/index.html#03%20Accessing%20Data/1%20Data%20Import%20UI.html)할 수는 있지만 자유롭게 사용할 수 있는 공개, Databricks 호스팅 dataset 저장소인 `/ databricks-datasets` 디렉토리를 통해 모든 Databricks 계정이 (더 쉽게) 이 데이터에 액세스 할 수 있다.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.48703858448E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"6eac81bf-e756-4655-8d1a-88c6c098fae3"},{"version":"CommandV1","origId":3576778972248707,"guid":"e2bf36b5-c137-4576-b7d9-e9f5390072d6","subtype":"command","commandType":"auto","position":1.25,"command":"%md \n먼저 첫 번째로 데이터를 로드한다. \n\n이 데이터 파일이 csv이므로 우리는 [spark-csv](https://github.com/databricks/spark-csv) 패키지를 사용하여 csv 파일형식을 지정하고, DataFrame으로 직접 로드할 수 있다. Apache Spark 2.0에서는 `spark-csv` 패키지를 사용할 필요가 없으며, 직접 데이터를 읽을 수 있다.\n데이터 과학자는 보통 R, python의 pandas에서 DataFrames를 접할 수 있다. Apache Spark DataFrames는 클러스터에 분산되어 있다는 점을 제외하고는 R이나 pandas의 DataFrame과 유사하다. DataFrame에 익숙하지 않다면, [a Gentle Introduction to Apache Spark on Databricks](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055043/484361/latest.html)를 읽는 것이 좋다.\n\n먼저, tax dataset을 읽는다.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.487038584488E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"3d860c70-5650-4d17-8f71-72081d497a15"},{"version":"CommandV1","origId":3576778972248708,"guid":"352c8fe5-3d0a-4770-b3f8-41515e11ffb9","subtype":"command","commandType":"auto","position":1.5,"command":"// in Apache Spark 1.6\nval taxes2013 = sqlContext\n  .read.format(\"com.databricks.spark.csv\")\n  .option(\"header\", \"true\")\n  .load(\"dbfs:/databricks-datasets/data.gov/irs_zip_code_data/data-001/2013_soi_zipcode_agi.csv\")","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">taxes2013: org.apache.spark.sql.DataFrame = [STATEFIPS: string, STATE: string ... 112 more fields]\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"Cancelled","error":null,"workflows":[],"startTime":1.487038585691E12,"submitTime":1.487 tureCols = Array(\"zip\", \"zipcode\", \"count\")\nval featureCols = prepped.columns.diff(nonFeatureCols)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">nonFeatureCols: Array[String] = Array(zip, zipcode, count)\nfeatureCols: Array[String] = Array(sum(zipcode), sum(single_returns), sum(joint_returns), sum(numdep), sum(total_income_amount), sum(taxable_interest_amount), sum(net_capital_gains), sum(biz_net_income))\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"Command skipped","error":null,"workflows":[],"startTime":1.487038619391E12,"submitTime":1.48703858518E12,"finishTime":1.487038619601E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"904cba36-8a5a-4418-80f3-7e58863fd6a8"},{"version":"CommandV1","origId":3576778972248753,"guid":"c5b3e9ee-a840-4d2f-b9a6-0e763cea1344","subtype":"command","commandType":"auto","position":15.0,"command":"%md \n이제 apache Spark에서`VectorAssembler`를 사용하여 모든 columns들을 하나의 단일 Vector로 모을 것이다. \n\n이렇게 하려면: \n1. input columns과 output columns을 설정하고, \n2. assembler를 사용하여 준비된 데이터를 최종 dataset으로 변환한다.\n\nML library에 대해:\n- spark.MLlib는 RDD를 이용한 Machine Learning 라이브러리이고, \n- spark.ML은 DataFrame을 이용한 Machine Learning 라이브러리이다.\n\n[참고]:\n\nspark.ml.feature.VectorAssembler.transform(dataset: Dataset[\\_]): DataFrame:\n- input dataset의 여러 columns을 하나의 vector인 features column으로 변환한다.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.487038585189E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"496d364a-34f7-4b05-b831-9903e797727c"},{"version":"CommandV1","origId":3871935588661175,"guid":"52c1e011-af44-42f0-acc2-339a92d4f7ac","subtype":"command","commandType":"auto","position":15.25,"command":"%md\n이 쯤 되어서 feature transformation을 상세히 보자.\n\n### spark.ml.feature 패키지\n`ml.feature` 패키지는 model fitting을 위해, raw data 또는 features를 보다 적합한 형식으로 변환하기 위한 common feature transformers를 제공한다. \n\n- 대부분의 feature transformers는 [Transformer](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Transformer.html)로 구현되는데, 이 class는 한 DataFrame을 다른 DataFrame으로 변환한다.(예 : [HashingTF](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/feature/HashingTF.html)) \n- 일부 feature transformers는 [IDF](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/feature/IDF.html)의 문서 빈도와 같이 dataset의 일부 집계 정보를 필요로하기 때문에 [Estimator](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Estimator.html)로 구현된다. 이러한 feature transformers의 경우 변환을 적용하기 위해 [Estimator().fit](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Estimator.html#fit%28dataset:org.apache.spark.sql.Dataset%5B_%5D,paramMaps:Array%5Borg.apache.spark.ml.param.ParamMap%5D%29:Seq%5BM%5D)을 호출하여 모델을 먼저 가져와야 한다(예 : [IDFModel](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/feature/IDFModel.html)).\n\nTransformation은 일반적으로 새 열을 입력 DataFrame에 추가하여 수행되므로 모든 입력 열이 넘겨진다.\n\n우리는 각 transformer를 최소한으로 만들려고하므로, feature tansformation pipeline 유연하게 구성해야 한다. [Pipeline](http://spark.apache.org/docs/late 래 LinearRegression class는 [Spark v1.6 scala API](https://spark.apache.org/docs/1.6.2/api/scala/index.html#org.apache.spark.ml.regression.LinearRegression)에서 확인할 수 있다.\n\n아직까지는 formaula만 정의된 상태이다. 학습이 시작되지 않았다.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.487038585352E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"01aed366-e4f8-44b0-9e9c-4b424e3851ad"},{"version":"CommandV1","origId":3576778972248760,"guid":"075b51c0-cbae-448e-bd6d-4b71669a0539","subtype":"command","commandType":"auto","position":18.0,"command":"import org.apache.spark.ml.regression.LinearRegression\n\nval lrModel = new LinearRegression()\n  .setLabelCol(\"count\")\n  .setFeaturesCol(\"features\")\n  .setElasticNetParam(0.5)\n\nprintln(\"Printing out the model Parameters:\")\nprintln(\"-\"*20)\nprintln(lrModel.explainParams)\nprintln(\"-\"*20)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Printing out the model Parameters:\n--------------------\naggregationDepth: suggested depth for treeAggregate (&gt;= 2) (default: 2)\nelasticNetParam: the ElasticNet mixing parameter, in range [0, 1]. For alpha = 0, the penalty is an L2 penalty. For alpha = 1, it is an L1 penalty (default: 0.0, current: 0.5)\nfeaturesCol: features column name (default: features, current: features)\nfitIntercept: whether to fit an intercept term (default: true)\nlabelCol: label column name (default: label, current: count)\nmaxIter: maximum number of itera ntln(\"MSE: \" + rm.meanSquaredError)\nprintln(\"MAE: \" + rm.meanAbsoluteError)\nprintln(\"RMSE Squared: \" + rm.rootMeanSquaredError)\nprintln(\"R Squared: \" + rm.r2)\nprintln(\"Explained Variance: \" + rm.explainedVariance + \"\\n\")","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">MSE: 2.6851960210649506\nMAE: 1.1942656524283206\nRMSE Squared: 1.638656773416859\nR Squared: -0.09582723306243901\nExplained Variance: 0.8019913848859219\n\nimport org.apache.spark.mllib.evaluation.RegressionMetrics\nrm: org.apache.spark.mllib.evaluation.RegressionMetrics = org.apache.spark.mllib.evaluation.RegressionMetrics@562e53df\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"Command skipped","error":null,"workflows":[],"startTime":1.487038631904E12,"submitTime":1.487038585478E12,"finishTime":1.487038632981E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"cd0d2e26-ca7d-4672-ac67-789657998ae1"},{"version":"CommandV1","origId":3576778972248769,"guid":"ba951396-7945-48fd-b38a-bbd9488c4c11","subtype":"command","commandType":"auto","position":19.0,"command":"%md \n결과가 신통치 않다. 모델을 훈련하는 다른 방법을 사용하자. 하드 코드 된 매개 변수가 있는 단일 모델을 훈련하는 대신 [pipeline](http://spark.apache.org/docs/latest/api/scala/index.html#org.apache.spark.ml.Pipeline)을 사용해보자.\n\npipeline은: \n1. 원시 데이터를 모델에 필요한 형태로 **전처리하기 위한 변환**을 제공할 뿐 아니라, \n2. 다양한 hyperparameters의 결합으로 모델을 직접적으로 훈련하는 - [hyperparameter tuning](https://en.wikipedia.org/wiki/Hyperparameter_optimization) 또는 grid search라 불리는- 방법을 제공한다. \n  - 이는 모델의 hyperparameter로 설정하고 싶은 모든 조합을 grid로 제공하기 때문에 grid search라고도 부른다.\n\n>예를 들어, `numTrees`를 20과 60, `maxDepth`를 5와 10으로 설정합니다. 매개 변수 그리드 빌더는이 두 변수의 모든 조합을 자동으로 구성합니다 (다른 변수도 함께 지정할 수 있음). 또한 [교차 검증](https://en.wikipedia.org/wiki/Cross-validation_%28statistics)을 사용하여 [overfitting](https://en.wikipedia.org/wiki/Overfitting)을 방지하도록 hyperparameter를 조정할 것이다. \n\n마지막으로 평가 메트릭(기본값은 RMSE)을 기반으로 모델을 선택할 수 있도록, [Regression Evaluator](http://spark.apache.org/docs/latest/api/scala/index.html#org.apache.spark.ml.evaluation.RegressionEvaluator)를 설정해야한다. \n\n>핵심적인 기능은 pipeline이 우리가 위에서 수동으로 설정하여 평가를 수행해야했던 것이 아닌, tuning을 위해 설정한 hyperparameters 그리드를 탐색하여 주어진 메트릭에 최적화된 모델과 hyperparameter를 자동으로 찾아낼 수 있다는 것이다.\n\n이제 random forest로 훈련해보자!\n\n[참고]: 우리가 시도할 hyperparameter 조합의 수와 사용 가능한 workers의 제한 때문에 시간이 좀 걸릴 수 있다.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.487038585485E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"f2221c28-911f-4a8d-a7cb-b2079482425c"},{"version":"CommandV1","origId":4411968494925975,"guid":"082cfc93-c4a7-45c8-8193-d33d552e0e15","subtype":"command","commandType":"auto","position":19.25,"command":"%md\n### 다음 cell에서 사용할 API:\n\nclass spark.ml.regression.RandomForestRegressor(...)\n> 연속형 또는 범주형 target에 대한 Random Forest 회귀 알고리즘\n\n- setFeaturesCol(value: String): RandomForestRegressor\n- setLabelCol(value: String): RandomForestRegressor\n\nclass spark.ml.tuning.ParamGridBuilder(...)\n> grid-search 기반 모델 selection에서 사용되는 param grid를 빌드\n\n- addGrid(param:TypeParam, value: Array[Type]): ParamGridBuilder.this.type -> *Array 값을 가지는 param을 추가*\n- build(): Array[ParamMap] -> *parma grid로 지정된 param grid를 리턴하고 빌드*\n\nclass spark.ml.tuning.CrossValidator(...)\n>K-fold cross validation은 dataset을 비 중첩 무작위로 분할 된 집합으로 분할하여 training  및 test를 교차로 수행하여 model selection을 수행한다.\n\n>예 : k = 3이면, K-fold cross validation는 3 회 (training, test) data set 쌍으로, 각각은 교육을 위해 2/3의 데이터를 사용하고 테스트를 위해 1/3의 데이터를 사용한다. 각 fold는 test set로 정확히 한 번 사용된다.\n\n- setEstimator(value: Estimator[_]): CrossValidator.this.type\n- setEstimatorParamMaps(value: Array[ParamMap]): CrossValidator.this.type\n- setEvaluator(value: Evaluator): CrossValidator.this.type\n\nclass spark.ml.evaluation.RegressionEvaluator(...)\n>알고리즘이 갖는 hyperparameters 키의 목록. \n>사용자는 setter 및 getter를 통해 hyperparameters 값을 설정하고 가져올 수 있다.\n\n- setLabelCol(value: String): RegressionEvaluator.this.type\n\nclass spark.ml.Pipeline\n>단순 pipeline은 하나의  Estimator로 동작하는 action이다.\n\n>pipeline은 일련의 단계로 구성되며 각각의 단계는 [Estimator](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Estimator.html) 또는 [transformer](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Transformer.html)이다. [Pipeline.fit](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Pipeline.html#fit%28dataset:org.apache.spark.sql.Dataset%5B_%5D%29:org.apache.spark.ml.PipelineModel)이 호출되면 스테이지가 순서대로 실행된다. \n\n>- stage가 Estimator 인 경우, model fit을 위해 입력 dataset에 대해 Estimator.fit 메서드가 호출된다. \n>- 그런 다음 transformer인 모델은 다음 stage의 input으로 사용할 dataset의 transform을 위해 사용된다. \n>- stage가 Transformer인 경우, 다음 stage를 위한 dataset을 생성하기 위해 [Transformer.transform](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Transformer.html#transform%28dataset:org.apache.spark.sql.Dataset%5B_%5D,paramMap:org.apache.spark.ml.param.ParamMap%29:org.apache.spark.sql.DataFrame) 메소드가 호출된다.\n>\n- [pipeline](http://spark.apache.org/docs/latest/api/scala/org/apache/spark/ml/Pipeline.html)으로 적합된 모델은 pipeline stage에서 적합
